    width: 1903px;
    position: relative;
    top: -181px;
    background: #fff;
    h1{
        font-size: 30px;
        font-weight: 300;
        line-height: 18px;
    }
    h1:first-child{
        color: #6772e5;
    }

`
const InContainer = styled.div`
    width: 1903px;
    height: 400px;
    background: #fff;
    position: relative;
    top: 49px;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-right: 50px;

`
const TitleBox = styled.div`

`



class ReadyToStart extends React.Component {
  render(){
    return (
        <Container>

            <InContainer>
                <TitleBox>
                    <Title title="Ready to get started?"/>
                    <Title title="Get in touch or create an account."/>
                </TitleBox>
                <Button btn="CREATE STRIPE ACCOUNT" btn2="CONTACT SALES"/>
            </InContainer>



        </Container>


    );
  }
}
export default ReadyToStart;
